import React from 'react';

const AuthLayout = ({ children }) => {
  return (
    <div 
      className="min-h-screen flex items-center justify-center p-4 bg-cover bg-center"
      style={{ 
        backgroundImage: "url('https://www.google.com/imgres?q=vacas%20gyr%20girolando%20y%20guzerat%20para%20poner%20de%20fondo&imgurl=https%3A%2F%2Frevistageneticabovina.com%2Fwp-content%2Fuploads%2F2020%2F06%2Fg3.jpg&imgrefurl=https%3A%2F%2Frevistageneticabovina.com%2Fmejoramiento-genetico%2Fgyr-lechero%2F&docid=5oRirqS-yBHphM&tbnid=gGGBGfDjXTutoM&vet=12ahUKEwiMzZzH8fqNAxVuTaQEHV-7FqAQM3oECE4QAA..i&w=938&h=627&hcb=2&ved=2ahUKEwiMzZzH8fqNAxVuTaQEHV-7FqAQM3oECE4QAA')",
        // Puedes cambiar la URL de la imagen por una que te guste más.
        // Esta imagen incluye varias razas de ganado como Gyr, Girolando, Holstein, Guzerat, Pardo Suizo, etc.
      }}
    >
      <div className="bg-white p-8 rounded-lg shadow-lg w-full max-w-md bg-opacity-90 backdrop-filter backdrop-blur-sm">
        {children}
      </div>
    </div>
  );
};

export default AuthLayout;

